import { Component, Inject } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { MAT_DIALOG_DATA, MatDialogRef } from '@angular/material/dialog';
import { UserService } from '../service/user.service';


@Component({
  selector: 'app-address-dialog',
  templateUrl: './address-dialog.component.html',
  styleUrls: ['./address-dialog.component.css']
})
export class AddressDialogComponent {
  addressForm: FormGroup;

constructor(public dialogRef:MatDialogRef<AddressDialogComponent>,@Inject(MAT_DIALOG_DATA) public data:any,private formBuilder: FormBuilder,private user:UserService){
  this.addressForm = this.formBuilder.group({
    houseNo: ['', Validators.required],
    landmark:['', Validators.required],
    street:['', Validators.required],
    city:['', Validators.required],
    pin:['', Validators.required]
  });
}
saveAddress() {
  if (this.addressForm.valid) {
    const newAddress = this.addressForm.value;
    this.user.changeAddress(newAddress).subscribe(response=>{
      this.dialogRef.close(newAddress);
    },(error)=>{

    };
    )
  }
}

cancel() {
  this.dialogRef.close();
}
}
<h2 mat-dialog-title>Shipping Address</h2>
<form [formGroup]="addressForm">
  <mat-dialog-content>
    <mat-form-field>
      <input matInput formControlName="houseNo" placeholder="House No" required>
      <mat-error *ngIf="addressForm.controls['houseNo'].hasError('required')">House No is required</mat-error>
    </mat-form-field>
    <mat-form-field>
      <input matInput formControlName="landmark" placeholder="Landmark" required>
      <mat-error *ngIf="addressForm.controls['landmark'].hasError('required')">Landmark is required</mat-error>
    </mat-form-field>
    <mat-form-field>
      <input matInput formControlName="street" placeholder="Street" required>
      <mat-error *ngIf="addressForm.controls['street'].hasError('required')">Street is required</mat-error>
    </mat-form-field>
    <mat-form-field>
      <input matInput formControlName="city" placeholder="City" required>
      <mat-error *ngIf="addressForm.controls['city'].hasError('required')">City is required</mat-error>
    </mat-form-field>
    <mat-form-field>
      <input matInput formControlName="pin" placeholder="Pincode" required>
      <mat-error *ngIf="addressForm.controls['pin'].hasError('required')">Pincode is required</mat-error>
    </mat-form-field>
  </mat-dialog-content>
  <mat-dialog-actions>
    <button mat-button (click)="cancel()">Cancel</button>
    <button mat-button [disabled]="addressForm.invalid" (click)="saveAddress()">Save</button>
  </mat-dialog-actions>
</form>
